/**
 * @brief 自己写的显示函数，显示大号标题
 * 
 * 这个是配合二维码之后的显示函数
 * 0x31就是1 0x32就是2 0x33就是3 十六进制ASCLL码
 * 字库生成如果是横屏请选择顺向逐列
 * 
 * @param x 显示的起始行坐标
 * @param y 显示的起始列坐标
 * @param size 32*32,48*48,64*64号,选64号字体就好
 * @param index 字库的字索引
 * @param font_color 字体颜色
 * @param back_color 背景颜色
 * @return null
 */
void LCD_ShowTitle(u16 x,u16 y,u16 size,u8 index,u16 font_color,u16 back_color)	
{ 
	u16 temp,t,t1;
	u16 y0=y;
	u16 csize= (size*size - 64)/8;//得到字体一个字符对应点阵集所占的字节数
	if(index == 0x31) index = 1;
	if(index == 0x32) index = 2;
	if(index == 0x33) index = 3;
	if(index == 0x2B) index = 10;
	 for(t=0;t<csize;t++)
	 { 
			switch(size)
			{
				case 32:temp=a32[index][t]; break;
				case 48:temp=a48[index][t]; break;
				case 64:temp=a64[index][t]; break;
			}
			 for(t1=0;t1<8;t1++)
			{
				if(temp&0x80)LCD_DrawPoint(x,y,font_color);
				else LCD_DrawPoint(x,y,back_color);
				temp<<=1;
				y++;
				if((y-y0)==size)
				{
					y=y0; x++;
					break;
				}
			} 
	 } 
}




